import {
    AutoComplete,
    Button,
    Cascader,
    Checkbox,
    Col,
    Form,
    Input,
    InputNumber,
    Row,
    Select,
  } from 'antd';
  import React, { useState } from 'react';

  export default function index() {

    const onFinish = (values) => {
      console.log('Received values of form: ', values);
    };
    return (
      <Form
      name="register"
      onFinish={onFinish}>  
      <Form.Item
      name="username"
      label="Username"
      rules={[
        {
          type: 'username',
          message: 'The input is not valid Username',
        },
        {
          required: true,
          message: 'Please input your Username',
        },
      ]}
    >
      <Input />
    </Form.Item>
    </Form>
    )
  }
